int firstUniqChar(string s) {
    int first = -1;

    char freq[256];
    for (int i = 0; i < 256; i++)
    {
        freq[i] = 0;
    }
    int len = s.size();
    cout << len << endl;
    for (int i = 0; i < len; i++)
    {
        freq[s[i]]++;
    }
    for (int i = 0; i < len; i++) {

        if (freq[s[i]] == 1)
        {
            first = i;
            break;
        }
         
    }

    return first;
}

